import React from "react";
import "../css/home.css";
import { Link } from "react-router-dom";
import { Card } from "reactstrap";
const HighlightMenu = () => {
  return (
    <div>
      <div className="highlight-page">
        <div className="container">
          <Card className="bg-card"></Card>
        </div>
      </div>
    </div>
  );
};
export default HighlightMenu;
